import { useLocation, Link } from "react-router-dom";
import logo_insta_black from '../IMG/logo_insta_black.png'
import logo_vimeo_black from '../IMG/logo_vimeo_black.png'
import './Footer.css';


class Footer extends Component {
    constructor() {
        super();
        this.state = {
        };
    }


    render() {
        return (
            <div id="footer">
                <img href="https://www.instagram.com/p.e.joubert/" className='logo' src={logo_insta_black}/>
                <img  className='logo' src={logo_vimeo_black}/>
            </div>
        );
    }
}

export default Footer
